import React, { Component } from 'react'
import './intro.css'

class Intro extends Component{
    render(){
        return(
            <div className="container2">
                <p>Hi there, I'm</p>
                <div className="c3">
                    <b>Lucia Wei :)</b>
                </div>
                <p className="c4">I'm a 4th year computer science major and art minor at Case Western Reserve interested in <b>user experience</b> and <b>design systems</b></p>
                <div className="c5">
                    <hr style={{color: 'rbg(255,255,255,.5)', width : '200px', display : 'inline-block'}}></hr>
                </div>

            </div>
            
        )
    }
}

export default Intro
